import React from "react";
import {Route,Switch,BrowserRouter} from "react-router-dom"
import Index from "./pages/Index.jsx";
function App(){
    return(
        <div>
        <BrowserRouter>
        <Switch>
        <Route exact path="/" component={Index} />
        </Switch>
        </BrowserRouter>
        </div>
    );
};


export default App;
